import React from 'react';

const GameChoices = (props) => {
    return (
        <div className="game-choices-container">
            <div
                id="b1"
                className="grid-item"
                onClick={() => props.gameSelected('TicTacToe')}
            >
                Tic Tac To
            </div>
            <div id="b2" className="grid-item" onClick={() => console.log('2')}>
                Chortle on my Balls
            </div>
            <div
                id="b3"
                className="grid-item"
                onClick={() => console.log('3')}
            ></div>
        </div>
    );
};

export default GameChoices;
